INSERT INTO `si_designation` (`ID`, `designation`) VALUES
(1, 'අතිරේක ලේකම්, අධ්‍යාපන අමාත්‍යාංශය'),
(2, 'කොමසාරිස් ජනරාල්, විභාග'),
(3, 'කොමසාරිස් ජනරාල්, අධ්‍යාපන ප්‍රකාශන'),
(4, 'ප්‍රධාන කොමසාරිස්වරයා (ගුරු ආයතන)'),
(5, 'අධ්‍යාපන අධ්‍යක්ෂ'),
(6, 'නියෝජ්‍ය අධ්‍යාපන අධ්‍යක්ෂ'),
(7, 'සහකාර අධ්‍යාපන අධ්‍යක්ෂ'),
(8, 'අතිරේක අධ්‍යාපන අධ්‍යක්ෂ'),
(9, 'විභාග කොමසාරිස්'),
(10, 'නියෝජ්‍ය විභාග කොමසාරිස්'),
(11, 'සහකාර විභාග කොමසාරිස්'),
(12, 'අධ්‍යාපන ප්‍රකාශන කොමසාරිස්'),
(13, 'නියෝජ්‍ය අධ්‍යාපන ප්‍රකාශන කොමසාරිස්'),
(14, 'සහකාර අධ්‍යාපන ප්‍රකාශන කොමසාරිස්'),
